sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  outputs.source_url = gs.getProperty('glide.servlet.uri');
  var instanceURL = gs.getProperty('x_snc_vac_mfgr_lab.shipping.api.instance');
  if (instanceURL == '') {
    instanceURL = 'https://mslabscdev01.service-now.com';
  }
  outputs.instance_url = instanceURL;
})(inputs, outputs);

